print(queue.dequeue())  # Output: 2
print(queue.dequeue())  # Output: 3
```

### Explanation

*   We define a `Stack` class to represent a stack data structure.
*   We define a `Queue` class that uses two stacks (`stack1` and `stack2`) to implement the queue.
*   The `enqueue` operation is performed by pushing elements onto `stack1`.
*   The `dequeue` operation is performed by popping elements from `stack2`. If `stack2` is empty, we transfer all elements from `stack1` to `stack2` to maintain the correct order.
*   The `is_empty` method checks if both stacks are empty.
*   The `size` method returns the total number of items in both stacks.

### Time Complexity

*   `enqueue`: O(1)
*   `dequeue`: O(n) in the worst case (when `stack2` is empty and we need to transfer all elements from `stack1` to `stack2`)
*   `is_empty`: O(1)
